import { useEffect, useState } from 'react';
import './App.css';
import Artist from './Artist';

function App() {

    const [artist_list, setArtistList] = useState([]);
    const [page, setPage] = useState(1);

    function prevPage() {
        if (page === 1) {
            return;
        }
        setPage(page - 1);
    }

    function nextPage() {
        setPage(page + 1);
    }

    useEffect(() => {
        fetch(`http://localhost:8000/artists?page=${page}&limit=50&`)
            .then(res => res.json())
            .then(json => {
                setArtistList(json);
            })
    }, [page]);

    return (
        <>
            <p>Page {page}</p>
            <div>Artists</div>
            {
                artist_list.map((artist) => {
                    return <Artist artist_name={artist['name']}  key={artist['id']} />;
                })
            }
            <button onClick={prevPage}>Page Precedante</button>
            <button onClick={nextPage}>Page Suivante</button>
        </>
    );
}

export default App;
